import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Header from "./Header";
import Home from "./Home";
import Cart from "./Cart";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="app">
        {/* Amazon header on every page*/}
        <Header />

        <Switch>
          <Route path="/cart">
            <Cart />
          </Route>

          <Route path="/login">
            <h1>Login page</h1>
          </Route>

          <Route path="/">
            {/* Home page */}
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
